import React from 'react'
import { useAuth } from './Auth'

const Profile = () => {
    const auth=useAuth()
    const handlelogout =() =>{
        auth.logout
    }
  return (
    <div> Profile page
        <button onClick={handlelogout}>Logout</button>
    </div>
  )
}
export default Profile
